Rust 1.77부터 C-문자열은 c 또는 cr 접두사와 함께 C-문자열 리터럴 구문을 사용하여 작성할 수 있습니다. 이전에는 NUL 바이트로 끝나는 C API와 상호 운용할 수 있는 유효한 문자열 리터럴을 올바르게 생성하기가 어려웠습니다. cstr 크레이트가 널리 사용되는 해결책이었지만, 이는 매우 비싼 proc-매크로를 컴파일해야 했습니다. 이제 C-문자열은 리터럴 구문 표기법을 사용하여 직접 작성할 수 있으며, 이는 자동으로 NUL 바이트로 끝나는 &core::ffi::CStr 유형의 값을 생성합니다. # use core::ffi::CStr; assert_eq!(c"hello", CStr::from_bytes_with_nul(b\"hello\0\").unwrap());
assert_eq!( c"byte escapes \xff work", CStr::from_bytes_with_nul(b"byte escapes \xff work\0").unwrap()
);
assert_eq!( c"unicode escapes \u{00E6} work", CStr::from_bytes_with_nul(b"unicode escapes \xc3\xa6 work\0").unwrap()
);
assert_eq!( c"unicode characters αβγ encoded as UTF-8", CStr::from_bytes_with_nul( b"unicode characters \xce\xb1\xce\xb2\xce\xb3 encoded as UTF-8\0" ) .unwrap()
);
assert_eq!( c"strings can continue \ on multiple lines", CStr::from_bytes_with_nul(b"strings can continue on multiple lines\0").unwrap()
); C-strings do not allow interior NUL bytes (such as with a \0 escape). Similar to regular strings, C-strings also support "raw" syntax with the cr prefix. These raw C-strings do not process backslash escapes which can make it easier to write strings that contain backslashes. Double-quotes can be included by surrounding the quotes with the # character. Multiple # characters can be used to avoid ambiguity with internal "# sequences. assert_eq!(cr"foo", c"foo");
// Number signs can be used to embed interior double quotes.
assert_eq!(cr#""foo""#, c"\"foo\"");
// This requires two #.
assert_eq!(cr##""foo"#"##, c"\"foo\"#");
// Escapes are not processed.
assert_eq!(cr"C:\foo", c"C:\\foo"); See The Reference for more details.

