Prior to the introduction of precise capturing use<..> bounds in Rust 1.82, correctly capturing a lifetime in an RPIT opaque type often required using the Captures trick. E.g.: #[doc(hidden)]
pub trait Captures<T: ?Sized> {}
impl<T: ?Sized, U: ?Sized> Captures<T> for U {} fn f<'a, T>(x: &'a (), y: T) -> impl Sized + Captures<(&'a (), T)> {
// ~~~~~~~~~~~~~~~~~~~~~
// This is called the `Captures` trick. (x, y)
}
#
# fn test<'t, 'x>(t: &'t (), x: &'x ()) {
# f(t, x);
# } With the use<..> bound syntax, the Captures trick is no longer needed and can be replaced with the following in all editions: fn f<'a, T>(x: &'a (), y: T) -> impl Sized + use<'a, T> { (x, y)
}
#
# fn test<'t, 'x>(t: &'t (), x: &'x ()) {
# f(t, x);
# } In Rust 2024, the use<..> bound can often be omitted entirely, and the above can be written simply as: fn f<'a, T>(x: &'a (), y: T) -> impl Sized { (x, y)
}
#
# fn test<'t, 'x>(t: &'t (), x: &'x ()) {
# f(t, x);
# } There is no automatic migration for this, and the Captures trick still works in Rust 2024, but you might want to consider migrating code manually away from using this old trick.

