Prior to the introduction of precise capturing use<..> bounds in Rust 1.82, it was common to use the "outlives trick" when a lifetime needed to be used in the hidden type of some opaque. E.g.: fn f<'a, T: 'a>(x: &'a (), y: T) -> impl Sized + 'a { // ~~~~ ~~~~ // ^ This is the outlives trick. // | // This bound is needed only for the trick. (x, y)
// ~~~~~~
// The hidden type is `(&'a (), T)`.
} This trick was less baroque than the Captures trick, but also less correct. As we can see in the example above, even though any lifetime components within T are independent from the lifetime 'a, we're required to add a T: 'a bound in order to make the trick work. This created undue and surprising restrictions on callers. Using precise capturing, you can write the above instead, in all editions, as: fn f<T>(x: &(), y: T) -> impl Sized + use<'_, T> { (x, y)
}
#
# fn test<'t, 'x>(t: &'t (), x: &'x ()) {
# f(t, x);
# } In Rust 2024, the use<..> bound can often be omitted entirely, and the above can be written simply as: fn f<T>(x: &(), y: T) -> impl Sized { (x, y)
}
#
# fn test<'t, 'x>(t: &'t (), x: &'x ()) {
# f(t, x);
# } There is no automatic migration for this, and the outlives trick still works in Rust 2024, but you might want to consider migrating code manually away from using this old trick.

