The 2024 Edition changes the drop scope of temporary values in the scrutinee [1] of an if let expression. This is intended to help reduce the potentially unexpected behavior involved with the temporary living for too long. Before 2024, the temporaries could be extended beyond the if let expression itself. For example: // Before 2024
# use std::sync::RwLock; fn f(value: &RwLock<Option<bool>>) { if let Some(x) = *value.read().unwrap() { println!("value is {x}"); } else { let mut v = value.write().unwrap(); if v.is_none() { *v = Some(true); } } // <--- Read lock is dropped here in 2021
} In this example, the temporary read lock generated by the call to value.read() will not be dropped until after the if let expression (that is, after the else block). In the case where the else block is executed, this causes a deadlock when it attempts to acquire a write lock. The 2024 Edition shortens the lifetime of the temporaries to the point where the then-block is completely evaluated or the program control enters the else block. // Starting with 2024
# use std::sync::RwLock; fn f(value: &RwLock<Option<bool>>) { if let Some(x) = *value.read().unwrap() { println!("value is {x}"); } // <--- Read lock is dropped here in 2024 else { let mut v = value.write().unwrap(); if v.is_none() { *v = Some(true); } }
} See the temporary scope rules for more information about how temporary scopes are extended. See the tail expression temporary scope chapter for a similar change made to tail expressions. The scrutinee is the expression being matched on in the if let expression.

