It is always safe to rewrite if let with a match. The temporaries of the match scrutinee are extended past the end of the match expression (typically to the end of the statement), which is the same as the 2021 behavior of if let. The if_let_rescope lint suggests a fix when a lifetime issue arises due to this change or the lint detects that a temporary value with a custom, non-trivial Drop destructor is generated from the scrutinee of the if let. For instance, the earlier example may be rewritten into the following when the suggestion from cargo fix is accepted: # use std::sync::RwLock;
fn f(value: &RwLock<Option<bool>>) { match *value.read().unwrap() { Some(x) => { println!("value is {x}"); } _ => { let mut s = value.write().unwrap(); if s.is_none() { *s = Some(true); } } } // <--- Read lock is dropped here in both 2021 and 2024
} In this particular example, that's probably not what you want due to the aforementioned deadlock! However, some scenarios may be assuming that the temporaries are held past the else clause, in which case you may want to retain the old behavior. The if_let_rescope lint is part of the rust-2024-compatibility lint group which is included in the automatic edition migration. In order to migrate your code to be Rust 2024 Edition compatible, run: cargo fix --edition After the migration, it is recommended that you review all of the changes of if let to match and decide what is the behavior that you need with respect to when temporaries are dropped. If you determine that the change is unnecessary, then you can revert the change back to if let. If you want to manually inspect these warnings without performing the edition migration, you can enable the lint with: // Add this to the root of your crate to do a manual migration.
#![warn(if_let_rescope)]

