When a temporary is created in order to evaluate an expression, the temporary is dropped based on the temporary scope rules . Those rules define how long the temporary will be kept alive. Before 2024, temporaries from tail expressions of a block would be extended outside of the block to the next temporary scope boundary. In many cases this would be the end of a statement or function body. In 2024, the temporaries of the tail expression may now be dropped immediately at the end of the block (before any local variables in the block). This narrowing of the temporary scope may cause programs to fail to compile in 2024. For example: // This example works in 2021, but fails to compile in 2024.
fn main() { let x = { &String::from("1234") }.len();
} In this example, in 2021, the temporary String is extended outside of the block, past the call to len(), and is dropped at the end of the statement. In 2024, it is dropped immediately at the end of the block, causing a compile error about the temporary being dropped while borrowed. The solution for these kinds of situations is to lift the block expression out to a local variable so that the temporary lives long enough: fn main() { let s = { &String::from("1234") }; let x = s.len();
} This particular example takes advantage of temporary lifetime extension . Temporary lifetime extension is a set of specific rules which allow temporaries to live longer than they normally would. Because the String temporary is behind a reference, the String temporary is extended long enough for the next statement to call len() on it. See the if let temporary scope chapter for a similar change made to temporary scopes of if let expressions.

