Within match, let, and other constructs, we match a pattern against a scrutinee . E.g.: let &[&mut [ref x]] = &[&mut [()]]; // x: &()
// ~~~~~~~~~~~~~~~ ~~~~~~~~~~~~
// Pattern Scrutinee Such a pattern is called fully explicit because it does not elide (i.e. "skip" or "pass") any references within the scrutinee. By contrast, this otherwise-equivalent pattern is not fully explicit: let [[x]] = &[&mut [()]]; // x: &() Patterns such as this are said to be using match ergonomics, originally introduced in RFC 2005 . Under match ergonomics, as we incrementally match a pattern against a scrutinee, we keep track of the default binding mode. This mode can be one of move, ref mut, or ref, and it starts as move. When we reach a binding, unless an explicit binding mode is provided, the default binding mode is used to decide the binding's type. For example, here we provide an explicit binding mode, causing x to be bound by reference: let ref x = (); // &() By contrast: let [x] = &[()]; // &() Here, in the pattern, we pass the outer shared reference in the scrutinee. This causes the default binding mode to switch from move to ref. Since there is no explicit binding mode specified, the ref binding mode is used when binding x.

