The no_mangle , export_name , and link_section attributes influence the symbol names and linking behavior of items. Care must be taken to ensure that these attributes are used correctly. Because the set of symbols across all linked libraries is a global namespace, there can be issues if there is a symbol name collision between libraries. Typically this isn't an issue for normally defined functions because symbol mangling helps ensure that the symbol name is unique. However, attributes like export_name can upset that assumption of uniqueness. For example, in previous editions the following crashes on most Unix-like platforms despite containing only safe code: fn main() { println!("Hello, world!");
} #[export_name = "malloc"]
fn foo() -> usize { 1 } In the 2024 Edition, it is now required to mark these attributes as unsafe to emphasize that it is required to ensure that the symbol is defined correctly: // SAFETY: There should only be a single definition of the loop symbol.
#[unsafe(export_name="loop")]
fn arduino_loop() { // ...
}

