The static_mut_refs lint detects taking a reference to a static mut . In the 2024 Edition, this lint is now deny by default to emphasize that you should avoid making these references. static mut X: i32 = 23;
static mut Y: i32 = 24; unsafe { let y = &X; // ERROR: shared reference to mutable static let ref x = X; // ERROR: shared reference to mutable static let (x, y) = (&X, &Y); // ERROR: shared reference to mutable static
} Merely taking such a reference in violation of Rust's mutability XOR aliasing requirement has always been instantaneous undefined behavior , even if the reference is never read from or written to . Furthermore, upholding mutability XOR aliasing for a static mut requires reasoning about your code globally , which can be particularly difficult in the face of reentrancy and/or multithreading. Note that there are some cases where implicit references are automatically created without a visible & operator. For example, these situations will also trigger the lint: static mut NUMS: &[u8; 3] = &[0, 1, 2]; unsafe { println!("{NUMS:?}"); // ERROR: shared reference to mutable static let n = NUMS.len(); // ERROR: shared reference to mutable static
}

