This example is similar to OnceLock in that it provides one-time initialization of a global, but it does not require std which is useful in a no_std context. Assuming your target supports atomics, then you can use an atomic to check for the initialization of the global. The pattern might look something like this: # use core::sync::atomic::AtomicUsize;
# use core::sync::atomic::Ordering;
#
# struct Args {
# verbose: bool,
# }
# fn parse_arguments() -> Args {
# Args { verbose: true }
# }
#
# struct GlobalState {
# verbose: bool,
# }
#
# impl GlobalState {
# const fn default() -> GlobalState {
# GlobalState { verbose: false }
# }
# fn new(verbose: bool) -> GlobalState {
# GlobalState { verbose }
# }
# fn example(&self) {}
# } const UNINITIALIZED: usize = 0;
const INITIALIZING: usize = 1;
const INITIALIZED: usize = 2; static STATE_INITIALIZED: AtomicUsize = AtomicUsize::new(UNINITIALIZED);
static mut STATE: GlobalState = GlobalState::default(); fn set_global_state(state: GlobalState) { if STATE_INITIALIZED .compare_exchange( UNINITIALIZED, INITIALIZING, Ordering::SeqCst, Ordering::SeqCst, ) .is_ok() { // SAFETY: The reads and writes to STATE are guarded with the INITIALIZED guard. unsafe { STATE = state; } STATE_INITIALIZED.store(INITIALIZED, Ordering::SeqCst); } else { panic!("already initialized, or concurrent initialization"); }
} fn get_state() -> &'static GlobalState { if STATE_INITIALIZED.load(Ordering::Acquire) != INITIALIZED { panic!("not initialized"); } else { // SAFETY: Mutable access is not possible after state has been initialized. unsafe { &*&raw const STATE } }
} fn main() { let args = parse_arguments(); let state = GlobalState::new(args.verbose); set_global_state(state); // ... let state = get_state(); state.example();
} This example assumes you can put some default value in the static before it is initialized (the const default constructor in this example). If that is not possible, consider using either MaybeUninit , or dynamic trait dispatch (with a dummy type that implements a trait), or some other approach to have a default placeholder. There are community-provided crates that can provide similar one-time initialization, such as the static-cell crate (which supports targets that do not have atomics by using portable-atomic ).

