UnsafeCell does not impl Sync, so it cannot be used in a static. You can create your own wrapper around UnsafeCell to add a Sync impl so that it can be used in a static to implement interior mutability. This approach can be useful if you have external locks or other guarantees that uphold the safety invariants required for mutable pointers. Note that this is largely the same as the raw pointers example. The wrapper helps to emphasize how you are using the type, and focus on which safety requirements you should be careful of. But otherwise they are roughly the same. # use std::cell::UnsafeCell;
#
# fn with_interrupts_disabled<T: Fn()>(f: T) {
# // A real example would disable interrupts.
# f();
# }
#
# #[repr(C)]
# struct GlobalState {
# value: i32,
# }
#
# impl GlobalState {
# const fn new() -> GlobalState {
# GlobalState { value: 0 }
# }
# } #[repr(transparent)]
pub struct SyncUnsafeCell<T>(UnsafeCell<T>); unsafe impl<T: Sync> Sync for SyncUnsafeCell<T> {} static STATE: SyncUnsafeCell<GlobalState> = SyncUnsafeCell(UnsafeCell::new(GlobalState::new())); fn set_value(value: i32) { with_interrupts_disabled(|| { let state = STATE.0.get(); unsafe { // SAFETY: This value is only ever read in our interrupt handler, // and interrupts are disabled, and we only use this in one thread. (*state).value = value; } });
