When the compiler sees a value of type ! (never) in a coercion site , it implicitly inserts a coercion to allow the type checker to infer any type: # #![feature(never_type)]
// This:
let x: u8 = panic!(); // ...is (essentially) turned by the compiler into:
let x: u8 = absurd(panic!()); // ...where `absurd` is the following function
// (it's sound because `!` always marks unreachable code):
fn absurd<T>(x: !) -> T { x } This can lead to compilation errors if the type cannot be inferred: # #![feature(never_type)]
# fn absurd<T>(x: !) -> T { x }
// This:
{ panic!() }; // ...gets turned into this:
{ absurd(panic!()) }; //~ ERROR can't infer the type of `absurd` To prevent such errors, the compiler remembers where it inserted absurd calls, and if it can't infer the type, it uses the fallback type instead: # #![feature(never_type)]
# fn absurd<T>(x: !) -> T { x }
type Fallback = /* An arbitrarily selected type! */ !;
{ absurd::<Fallback>(panic!()) } This is what is known as "never type fallback". Historically, the fallback type has been () (unit). This caused ! to spontaneously coerce to () even when the compiler would not infer () without the fallback. That was confusing and has prevented the stabilization of the ! type. In the 2024 edition, the fallback type is now !. (We plan to make this change across all editions at a later date.) This makes things work more intuitively. Now when you pass ! and there is no reason to coerce it to something else, it is kept as !. In some cases your code might depend on the fallback type being (), so this can cause compilation errors or changes in behavior.

