The Rust Style Guide includes rules for sorting that rustfmt applies in various contexts, such as on imports. Previous versions of the Style Guide and Rustfmt generally used an "ASCIIbetical" based approach. In the 2024 Edition this is changed to use a version-sort like algorithm that compares Unicode characters lexicographically and provides better results in ASCII digit comparisons. For example with a given (unsorted) input: use std::num::{NonZeroU32, NonZeroU16, NonZeroU8, NonZeroU64};
use std::io::{Write, Read, stdout, self}; In the prior Editions, rustfmt would have produced: use std::io::{self, stdout, Read, Write};
use std::num::{NonZeroU16, NonZeroU32, NonZeroU64, NonZeroU8}; In the 2024 Edition, rustfmt now produces: use std::io::{self, Read, Write, stdout};
