} 이제 프로젝트에 새 크레이트를 추가하려면 Cargo.toml에 추가하면 두 번째 단계가 없습니다. Cargo를 사용하지 않는 경우 이미 --extern 플래그를 전달하여 rustc에 외부 크레이트의 위치를 제공해야 했으므로 거기서 하던 일을 계속하면 됩니다. 예외 이 규칙에는 한 가지 예외가 있는데, 바로 "sysroot" 크레이트입니다. 이것들은 Rust 자체와 함께 배포되는 크레이트입니다. 일반적으로 이것들은 매우 특수한 상황에서만 필요합니다. 1.41부터 rustc는 extern crate와 유사한 방식으로 주어진 크레이트 이름을 자동으로 추가하는 --extern=CRATE_NAME 플래그를 허용합니다. 빌드 도구는 이를 사용하여 sysroot 크레이트를 크레이트의 프렐루드에 주입할 수 있습니다. Cargo는 proc_macro 크레이트에 사용하지만 이를 표현하는 일반적인 방법이 없습니다. sysroot 크레이트를 명시적으로 가져와야 하는 몇 가지 예는 다음과 같습니다. std : 일반적으로 이것은 필요하지 않습니다. 왜냐하면 std는 크레이트가 #![no_std] 로 표시되지 않는 한 자동으로 가져오기 때문입니다. core : Usually this is not necessary, because core is automatically imported, unless the crate is marked with #![no_core] . For example, some of the internal crates used by the standard library itself need this. proc_macro : This is automatically imported by Cargo if it is a proc-macro crate starting in 1.42. extern crate proc_macro; would be needed if you want to support older releases, or if using another build tool that does not pass the appropriate --extern flags to rustc. alloc : alloc 크레이트의 항목은 일반적으로 std 크레이트의 재내보내기를 통해 액세스됩니다. 할당을 지원하는 no_std 크레이트로 작업하는 경우 alloc을 명시적으로 가져와야 할 수 있습니다. test : 이것은 nightly 채널 에서만 사용할 수 있으며 일반적으로 불안정한 벤치마크 지원에만 사용됩니다. 매크로 extern crate의 또 다른 용도는 매크로를 가져오는 것이었습니다. 더 이상 필요하지 않습니다. 매크로는 다른 항목과 마찬가지로 use로 가져올 수 있습니다. 예를 들어, 다음과 같은 extern crate 사용: #[macro_use]
extern crate bar; fn main() { baz!();
} 다음과 같이 변경할 수 있습니다. use bar::baz; fn main() { baz!();
} 크레이트 이름 바꾸기 다음과 같이 as를 사용하여 크레이트 이름을 바꾸고 있었다면: extern crate futures as f; use f::Future; extern crate 줄을 자체적으로 제거하는 것은 작동하지 않습니다. 다음과 같이 해야 합니다. use futures as f; use self::f::Future; 이 변경은 f를 사용하는 모든 모듈에서 발생해야 합니다.

