최소 Rust 버전: 1.32 Rust 2018은 Rust 2015에 비해 경로 처리를 단순화하고 통합합니다. Rust 2015에서는 use 선언의 경로가 다른 곳과 다르게 작동합니다. 특히 use 선언의 경로는 항상 크레이트 루트에서 시작하는 반면 다른 코드의 경로는 암시적으로 현재 범위에서 시작했습니다. 이러한 차이점은 최상위 모듈에 영향을 미치지 않았으므로 하위 모듈이 있는 충분히 큰 프로젝트에서 작업할 때까지 모든 것이 간단해 보였습니다. Rust 2018에서는 use 선언 및 기타 코드의 경로가 최상위 모듈과 모든 하위 모듈에서 동일하게 작동합니다. 현재 범위의 상대 경로, 외부 크레이트 이름으로 시작하는 경로 또는 ::, crate, super 또는 self로 시작하는 경로를 사용할 수 있습니다. 다음과 같이 보이는 코드: // Rust 2015 extern crate futures; use futures::Future; mod foo { pub struct Bar;
} use foo::Bar; fn my_poll() -> futures::Poll { ... } enum SomeEnum { V1(usize), V2(String),
} fn func() { let five = std::sync::Arc::new(5); use SomeEnum::*; match ... { V1(i) => { ... } V2(s) => { ... } }
} extern crate 줄을 삭제할 수 있다는 점을 제외하고 Rust 2018에서도 똑같이 보일 것입니다. // Rust 2018 use futures::Future; mod foo { pub struct Bar;
} use foo::Bar; fn my_poll() -> futures::Poll { ... } enum SomeEnum { V1(usize), V2(String),
} fn func() { let five = std::sync::Arc::new(5); use SomeEnum::*; match ... { V1(i) => { ... } V2(s) => { ... } }
} 동일한 코드는 하위 모듈에서도 완전히 수정되지 않은 상태로 작동합니다. // Rust 2018 mod submodule { use futures::Future; mod foo { pub struct Bar; } use foo::Bar; fn my_poll() -> futures::Poll { ... } enum SomeEnum { V1(usize), V2(String), } fn func() { let five = std::sync::Arc::new(5); use SomeEnum::*; match ... { V1(i) => { ... } V2(s) => { ... } } }
} 이렇게 하면 프로젝트에서 코드를 쉽게 이동할 수 있고 다중 모듈 프로젝트에 추가적인 복잡성을 도입하는 것을 방지할 수 있습니다.

