2021 에디션의 일부로 Rust 2018 코드베이스를 Rust 2021로 자동 마이그레이션하는 데 도움이 되도록 마이그레이션 린트인 rust_2021_incompatible_closure_captures가 추가되었습니다. 코드를 Rust 2021 에디션과 호환되도록 마이그레이션하려면 다음을 실행하십시오. cargo fix --edition 아래에서는 자동 마이그레이션이 실패하거나 마이그레이션 작동 방식을 더 잘 이해하고 싶은 경우 Rust 2021과 호환되는 클로저 캡처를 사용하도록 코드를 수동으로 마이그레이션하는 방법을 살펴봅니다. 클로저에 의해 캡처된 변수를 변경하면 두 가지 경우에 프로그램 동작이 변경되거나 컴파일이 중지될 수 있습니다. 삭제 순서 변경 또는 소멸자가 실행될 때( 세부 정보 ); 클로저가 구현하는 트레이트 변경( 세부 정보 ). Whenever any of the scenarios below are detected, cargo fix will insert a "dummy let" into your closure to force it to capture the entire variable: let x = (vec![22], vec![23]);
let c = move || { // "Dummy let" that forces `x` to be captured in its entirety let _ = &x; // 그렇지 않으면 여기에서 `x.0`만 캡처됩니다 println!("{:?}", x.0);
}; 이것은 보수적인 분석입니다. 많은 경우 이러한 더미 let은 안전하게 제거할 수 있으며 프로그램은 정상적으로 작동합니다.

