}; 여기서 let _ = x 문은 _ 패턴이 오른쪽을 완전히 무시하고 x가 메모리의 한 위치(이 경우 변수)에 대한 참조이므로 아무 작업도 수행하지 않습니다. 이 변경 자체(더 적은 값 캡처)는 제안을 트리거하지 않지만 아래의 "삭제 순서" 변경과 함께 트리거할 수 있습니다. 미묘함: 우리가 삽입하는 "더미 let" let _ = &x와 같이 no-op이 아닌 다른 유사한 표현식이 있습니다. 이것은 오른쪽(&x)이 메모리의 한 위치에 대한 참조가 아니라 먼저 평가되어야 하는 표현식이기 때문입니다(그리고 그 결과는 버려집니다).

