클로저가 변수 t에서 값의 소유권을 가져오면 해당 값은 변수 t가 범위를 벗어날 때가 아니라 클로저가 삭제될 때 삭제됩니다. # fn move_value<T>(_: T){}
{ let t = (vec![0], vec![0]); { let c = || move_value(t); // t가 여기로 이동됩니다 } // c is dropped, which drops the tuple `t` as well
} // t goes out of scope here 위의 코드는 Rust 2018과 Rust 2021 모두에서 동일하게 실행됩니다. 그러나 클로저가 변수의 _일부_에 대한 소유권만 갖는 경우에는 차이가 있을 수 있습니다. # fn move_value<T>(_: T){}
{ let t = (vec![0], vec![0]); { let c = || { // In Rust 2018, captures all of `t`. // In Rust 2021, captures only `t.0` move_value(t.0); }; // In Rust 2018, `c` (and `t`) are both dropped when we // exit this block. // // In Rust 2021, `c` and `t.0` are both dropped when we // exit this block. } // Rust 2018에서는 `t`의 값이 이동되어 삭제되지 않습니다.
//
// Rust 2021에서는 `t.0`의 값이 이동되었지만 `t.1`은 남아 있으므로 여기서 삭제됩니다.
} 대부분의 경우 다른 시간에 값을 삭제하는 것은 메모리가 해제되는 시점에만 영향을 미치며 중요하지 않습니다. 그러나 일부 Drop 구현(일명 소멸자)에는 부작용이 있으며 이러한 경우 삭제 순서를 변경하면 프로그램의 의미 체계가 변경될 수 있습니다. 이러한 경우 컴파일러는 전체 변수를 캡처하도록 강제하기 위해 더미 let을 삽입하도록 제안합니다.

