클로저는 캡처하는 값에 따라 다음 트레이트를 자동으로 구현합니다. Clone : 모든 캡처된 값이 Clone인 경우. 자동 트레이트 와 같은 Send , Sync 및 UnwindSafe : 모든 캡처된 값이 주어진 트레이트를 구현하는 경우. Rust 2021에서는 다른 값이 캡처되므로 클로저가 구현할 트레이트에 영향을 줄 수 있습니다. 마이그레이션 린트는 각 클로저를 테스트하여 이전에 주어진 트레이트를 구현했는지 여부와 지금도 구현하는지 여부를 확인합니다. 이전에 구현되었지만 더 이상 구현되지 않는 트레이트를 발견하면 "더미 let"이 삽입됩니다. 예를 들어, 스레드 간에 원시 포인터를 전달할 수 있도록 허용하는 일반적인 방법은 이를 구조체로 래핑한 다음 래퍼에 대해 Send/Sync 자동 트레이트를 구현하는 것입니다. thread::spawn에 전달되는 클로저는 래퍼 내의 특정 필드를 사용하지만 전체 래퍼는 관계없이 캡처됩니다. 래퍼가 Send/Sync이므로 코드는 안전한 것으로 간주되어 성공적으로 컴파일됩니다. 분리된 캡처를 사용하면 클로저에 언급된 특정 필드만 캡처되므로 원래 Send/Sync가 아니었던 래퍼의 목적을 무효화합니다. use std::thread; struct Ptr(*mut i32);
unsafe impl Send for Ptr {} let mut x = 5;
let px = Ptr(&mut x as *mut i32); let c = thread::spawn(move || { unsafe { *(px.0) += 10; }
}); // 클로저가 Send가 아닌 px.0을 캡처했습니다

